import React from 'react';
import logo from './assets/logo.png';
import { Link } from 'react-router-dom';
import './App.css';

export default function SideBar() {
  return (
    <div className="SideBar">
      <div className="logoDiv">
        <img src={logo} alt="logo" />
      </div>
      <Link to="/home">
        <a className="full-text">Home</a>
        <a className="short-text">H</a>
      </Link>
      <Link to="/tictactoe">
        <a className="full-text">Tictac</a>
        <a className="short-text">Ti</a>
      </Link>
      <Link to="/tower">
        <a className="full-text">Tower</a>
        <a className="short-text">To</a>
      </Link>
      <Link to="/snek">
        <a className="full-text">Snek</a>
        <a className="short-text">S</a>
      </Link>
    </div>
  );
}
